import DeleteForeverIcon from '@mui/icons-material/DeleteForever';
import EditIcon from '@mui/icons-material/Edit';

export default function FilePage(){
    return(
        <Box>
            <Box sx={{ alignItems: "center", display: "flex", flexWrap: "wrap", padding: "2%", cursor: 'pointer', marginBottom:"0.5%"}}>
            <Typography variant='h1' fontSize="1rem">Slide 1 : Variable</Typography>
            <div style={{marginLeft:"auto"}}>
            <Button style={{backgroundColor:"grey"}}variant="contained" startIcon={<EditIcon/>}>
                Edit
            </Button>
            <Button style={{backgroundColor:"red"}}variant="contained" startIcon={<DeleteForeverIcon/>}>
                Delete
            </Button>
            </div>
            </Box>
        </Box>
    )
}
